const Course = (props) => {
  const parts = props.course.parts
  return (
    <div>
      <h1>
        {props.course.name}
      </h1>
      {parts.map(part => <p key={part.id}>{part.name} {part.exercises}</p>)}

    </div>

  )

}
export default Course
